import React from 'react';


const Login = () => {
    return ( 

            <div className="contenedor">
                <div className="contenedor-formulario">
                        <form>
                            <div className="row">
                                <div className="col-md-2 bg-danger">
                                        1
                                </div>
                                <div className="col-md-10 bg-success">
                                            2
                                </div>  
                            </div>
                        </form>
                </div>
            </div>

     );
}
 
export default Login;
